const express = require('express')
const compression = require('compression')
const cookieParser = require('cookie-parser')
const csrf = require('xsrf')
const cors = require('cors')
const router = require('./router')

const port = process.env.PORT || 3001

const app = express()

const csrfProtection = csrf({
  cookie: true,
  ignoreMethods: ['HEAD', 'OPTIONS'],
  checkPathReg: /^\/music\/api/
})
app.use(cors())
app.use(cookieParser())
app.use(csrfProtection)
app.use('/', router)

app.get('/', function (req, res, next) {
  res.cookie('XSRF-TOKEN', req.csrfToken())
  return next()
})

app.use(compression())

app.use(express.static('./dist'))

app.use(function (err, req, res, next) {
  if (err.code !== 'EBADCSRFTOKEN') {
    return next()
  }

  // handle CSRF token errors here
  res.status(403)
  res.send('<div style="padding-top: 200px; text-align: center"><img style="vertical-align: middle" width="100" src="data:image/jpeg;base64," ><p style="display: inline-block;">请使用合规的方法访问接口</p></div>')
})

module.exports = app.listen(port, function (err) {
  if (err) {
    console.log(err)
    return
  }
  console.log('Listening at http://localhost:' + port + '\n')
})
